import React, { Component } from "react";

import CircleChart from "./CircleChart";

class SoMeCircleChart extends Component {
  constructor(props) {
    super(props);

    this.state = {
      first: "200",
      second: "300",
      third: "400",
      fourth: "500",

    };
  }

  render() {
    const data = [
      {
        name: "Group A",
        value: 200
      },
      {
        name: "Group B",
        value: 300
      },
      {
        name: "Group C",
        value: 400
      },
      {
        name: "Group D",
        value: 700
      },  
    ];



    return (
      <div>
        <CircleChart title="SoMe Followers" data={data}  />
      </div>
    );
  }
}

export default SoMeCircleChart;
